//Working on Drag and Drop  
.then(() => {
  const dataTransfer = new DataTransfer();
  // Test case to check if the module is empty
  cy.get(modelingViewSelector.componentLibraryModule).trigger('dragstart', {
    dataTransfer,
    force: true
  }).then(() => {
    cy.get(modelingViewSelector.modelingViewCanvas).trigger('drop', {
      dataTransfer,
      force: true,
      clientX: 250,
      clientY: 250
    });
  });
}).then(() => {
  cy.get(modelingViewSelector.drawingCanvasModuleText).should('exist');
}).then(() => {
  cy.get(modelingViewSelector.drawingCanvasModule).rightclick().then(() => {
    cy.get(modelingViewSelector.componentSpecFeatureSettingsModuleSelect).should('have.value', '');
  });
});
const numMicrocontrollers = 52;
const controllersPerRow = 10;
const distanceBetweenWireAndController = 100;
const startX = 250; // Starting x-coordinate
const startY = 120; // Starting y-coordinate
const rowGap = 400; // Gap between rows
for (let i = 0; i < numMicrocontrollers; i++) {
  const row = Math.floor(i / controllersPerRow);
  const col = i % controllersPerRow;
  const x = startX + col * distanceBetweenWireAndController;
  const y = startY + row * rowGap;
  cy.get(modelingViewSelector.componentLibraryMicrocontroller).trigger('dragstart', {
    dataTransfer,
    force: true
  }).then(() => {
    cy.get(modelingViewSelector.modelingViewCanvas).trigger('drop', {
      dataTransfer,
      force: true,
      clientX: x,
      clientY: y
    });
  });
  // If there are more controllers than wires, add a wire
  if (i < 42) {
    const wireX = x + distanceBetweenWireAndController / 2;
    const wireY = y + distanceBetweenWireAndController / 2 + 30;
    cy.get(modelingViewSelector.componentLibraryCommunicationLine).trigger('dragstart', {
      dataTransfer,
      force: true
    }).then(() => {
      cy.get(modelingViewSelector.modelingViewCanvas).trigger('drop', {
        dataTransfer,
        force: true,
        clientX: wireX,
        clientY: wireY
      });
    });
  }
}
